
USE `NBA Data`;
CREATE TABLE IF NOT EXISTS nbaplayersdraft_Total_Percentage_Stats (
    `id` INT,
    `years_active` INT,
    `games` INT,
    `minutes_played` INT,
    `points` INT,
    `total_rebounds` INT,
    `assists` INT,
    `field_goal_percentage` NUMERIC(4, 3),
    `Column_3_point_percentage` NUMERIC(4, 3),
    `free_throw_percentage` NUMERIC(4, 3)
);
